column3:
Who are we?
Animal Project was founded in 2020 by animal lovers with different professions and experiences. For decades, our team members  have been independently helping strays and raising awareness through personal channels.

What is our goal?
We exist so that dogs and cats no longer have to live in the streets of Georgia. Our goal is to create a habitable, comfortable environment for companion animals and raise awareness within our communities.

How are we working on this goal?
Our team heavily relies on international best practices and experience. Our areas of work include:
· Raising social awareness;
· Advocating with the government;
· Charitable and humanitarian projects in collaboration with the private sector, donor organizations, and local communities;

column4:
Ვინ ვართ ჩვენ?
Animal Project დაარსდა 2020 წელს ცხოველთა მოყვარულთა მიერ სხვადასხვა პროფესიისა და გამოცდილების მქონე. ათწლეულების მანძილზე ჩვენი გუნდის წევრები დამოუკიდებლად ეხმარებოდნენ მაწანწალაებს და ამაღლებდნენ ცნობიერებას პირადი არხებით.

რა არის ჩვენი მიზანი?
ჩვენ იმისთვის ვარსებობთ, რომ საქართველოს ქუჩებში ძაღლები და კატები აღარ იცხოვრონ. ჩვენი მიზანია შევქმნათ საცხოვრებელი, კომფორტული გარემო კომპანიონი ცხოველებისთვის და ცნობიერების ამაღლება ჩვენს თემებში.

როგორ ვმუშაობთ ამ მიზანზე?
ჩვენი გუნდი დიდწილად ეყრდნობა საერთაშორისო საუკეთესო პრაქტიკას და გამოცდილებას. ჩვენი მუშაობის სფეროები მოიცავს:
· სოციალური ცნობიერების ამაღლება;
· მთავრობასთან ადვოკატირება;
· საქველმოქმედო და ჰუმანიტარული პროექტები კერძო სექტორთან, დონორ ორგანიზაციებთან და ადგილობრივ თემებთან თანამშრომლობით;
